@EU_Commission Is it normal that Spain has been fined 15 million euros and 84,000 a day for not transposing a directive and that the directive of interim civil servants is not transposed and they want to throw us out on the streets?
#FijezaYa
#InspecciónYa

@EU_Commission Can you please elaborate with some links to published data on connection between biodiversity and COVID pandemic?

It is an interesting point so I'd like to know more about it.

Thanks.

@EU_Commission How about you suggest to your member states that they cease trashing certain vaccine manufacturers??
And use those vaccines already in your possession before screaming for more!
(This from a rabid anti-brexiteer - you are making me look extremely foolish)

@EU_Commission But the #EU's extraordinary bureaucracy, inherent ineptitude and tardiness has ensured by their failure to get a meaningful vaccination system going across #Europe, that member states have imposed their own restrictions.
Richer, non EU states are responding better.
#EUexit now!
